import React from "react";
import Card from "../UI/Card";
import "./style.css";

const Sidebar = (props) => {
  return (
    <div className="sidebarContainer">
      <Card
        style={{
          marginBottom: "20px",
          padding: "20px",
          boxSizing: "border-box",
        }}
      >
        <div className="cardHeader">
          <span>About Us</span>
        </div>
        <div className="profileImageContainer">
          <img src={require("../../blogPostImage/khan.jpg")} alt="" />
        </div>
        <div className="cardBody">
            <p>My Name is Zaid Khan. I am a SoftWare Developer specialization in Front end development</p>
        </div>
      </Card>

      <Card>
        <div className="cardHeader">
          <span>Social Network</span>
        </div>
      </Card>
    </div>
  );
};

export default Sidebar;
